#!/usr/bin/env python3

dna = ''

dna_up = dna.upper()
print(len(dna_up))

# This is counting the number of Ts in the original sequence
tCount = dna_up.count('T')
out1 = 'This is the number of T\'s in the original sequence: {}'
new_out1 = out1.format(tCount)
print(new_out1)

# This is counting the number Us in the sequence after changing Ts to Us (i.e., DNA to RNA)
dna_tToU = dna_up.replace('T','U')
uCount = dna_tToU.count('U')
out2 = 'This is the number of U\'s in the new sequence after replacement: {}'
new_out2 = out2.format(uCount)
print(new_out2)

# This is replacing the Ts and ts in the sequence with Us and us, respectively
dna = ''

TCount = dna.count('T')
tCount = dna.count('t')
out3 = 'The number of T\'s is: {}.\nThe number of t\'s is: {}.'
new_out3 = out3.format(TCount,tCount)
print(new_out3)

dna_TtoU = dna.replace('T','U')
dna_TtoUtToU = dna_TtoU.replace('t','u')
UCount = dna_TtoUtToU.count('U')
uCount = dna_TtoUtToU.count('u')
out4 = 'The number of U\'s is: {}.\nThe number of u\'s is: {}.'
new_out4 = out4.format(UCount,uCount)
print(new_out4)
